export default function Competance() {
    return (
        <div className="Competance">
            <div style={{
                backgroundColor: "white",
                width: 18,
                height: 5,
                borderRadius: 100,
                marginRight: 11
            }}/>
            <div className="me-3">React</div>
            <div style={{
                backgroundColor: "white",
                width: 18,
                height: 5,
                borderRadius: 100,
                marginRight: 11
            }}/>
            <div className="me-3">Codeigniter</div>
            <div style={{
                backgroundColor: "white",
                width: 18,
                height: 5,
                borderRadius: 100,
                marginRight: 11
            }}/>
            <div className="me-3">Adobe Illustrator</div>
            <div style={{
                backgroundColor: "white",
                width: 18,
                height: 5,
                borderRadius: 100,
                marginRight: 11
            }}/>
            <div className="me-3">Adobe Photoshop</div>
        </div>
    )
}
